--
-- Table structure for table `lc_receipt_master`
--

/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE IF NOT EXISTS `lc_receipt_master` (
  `lc_receipt_no` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `lc_receipt_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `cust_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `mode` int DEFAULT '1' COMMENT '1 for cash and 2 for cheque',
  `amount` int DEFAULT NULL,
  `cheque_details` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT 'No',
  `agent_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `emp_id` int DEFAULT NULL,
  `discount` double DEFAULT '0',
  PRIMARY KEY (`lc_receipt_no`),
  KEY `cust_id` (`cust_id`),
  KEY `agent_id` (`agent_id`),
  KEY `emp_id` (`emp_id`),
  KEY `lc_payment_mode` (`mode`),
  CONSTRAINT `lc_payment_mode` FOREIGN KEY (`mode`) REFERENCES `payment_modes` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `lc_receipt_master_ibfk_1` FOREIGN KEY (`cust_id`) REFERENCES `customer_master` (`cust_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `lc_receipt_master_ibfk_2` FOREIGN KEY (`agent_id`) REFERENCES `agent_master` (`agent_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `lc_receipt_master_ibfk_3` FOREIGN KEY (`emp_id`) REFERENCES `employees` (`emp_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

