CREATE DEFINER=`root`@`localhost` FUNCTION `get_customer_total_lc_due_before_lc_receipt_no`(in_lc_receipt_no varchar(255)) RETURNS int
    DETERMINISTIC
BEGIN
	
	DECLARE temp_opening_lc integer;
	DECLARE temp_total_billed_lc integer;
  DECLARE temp_total_received_lc integer;
  select opening_lc into temp_opening_lc  from customer_balance where cust_id=(select cust_id from lc_receipt_master where lc_receipt_no=in_lc_receipt_no);
  IF isnull(temp_opening_lc) then
    set temp_opening_lc=0;
  END IF;
  select get_customer_total_billed_lc_before_lc_receipt_no(in_lc_receipt_no) into temp_total_billed_lc;
  
  IF isnull(temp_total_billed_lc) then
    set temp_total_billed_lc=0;
  END IF;
  
  select get_customer_total_received_lc_before_lc_receipt_no(in_lc_receipt_no) into temp_total_received_lc;
  
  IF isnull(temp_total_received_lc) then
    set temp_total_received_lc=0;
  END IF;
  
	RETURN temp_opening_lc+temp_total_billed_lc-temp_total_received_lc;
END ;;
